import React, { useState } from 'react';
import axios from 'axios';
const App = (props) => {

    const [clients, setClients] = useState([
        { id: 1, nom: "RAKOTOBE Marco" },
        { id: 2, nom: "RANDRIA BG" },
        { id: 3, nom: "RAJAO Froncois" },
        { id: 4, nom: "DOKOTERA Bao" }
    ])

    return (
        <div>

            <p>
                {clients.map((client) => <li></li>)}
            </p>
        </div >
    );
};

export default App;
